import React from "react";
import { Link } from 'react-router-dom';
const Navbar = () => {
  return (
    <nav className="bg-indigo-700 shadow-lg">
        <div className="container mx-auto">
            <div className="sm:flex justify-between items-center">
                <Link to="/" className="text-white text-2xl font-bold p-3 mr-4"><i className="fas fa-mobile-android-alt"></i> SmartPhone Corner</Link>

                <button className="text-white sm:hidden focus:outline-none">
                    <i className="fas fa-bars"></i>
                </button>

                <ul className="text-gray-300 sm:flex sm:self-center text-1xl border-t sm:border-none font-sans mt-4 sm:mt-0 hidden">
                    <li className="sm:inline-block">
                        <Link to="#" className="p-3 hover:text-white"><i className="fa fa-home" aria-hidden="true"></i> HOME</Link>
                    </li>
                    <li className="sm:inline-block">
                        <Link to="/products" className="p-3 hover:text-white"><i className="fa fa-shopping-cart" aria-hidden="true"></i> PRODUCTS</Link>
                    </li>
                    <li className="sm:inline-block">
                        <Link to="/about" className="p-3 hover:text-white"><i className="fa fa-address-card" aria-hidden="true"></i> ABOUT</Link>
                    </li>
                </ul>
            </div>
        </div>
    </nav>
  );
};

export default Navbar;
